import { useState } from "react";
import axios from "axios";
import { useEffect } from "react";

const FetchName = () =>
    {
        const [name,setName]=useState([])
        var x="a"
        const FetchSearch = () =>
        {
        axios
        .get(` https://finnhub.io/api/v1/search?q=apple&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)

        .then((response) =>
        {
            const {symbol} =response.data.result[0]
           
           x=x+symbol
            
              console.log(symbol)
              setName(symbol)
              
               
            
        })
    }

        useEffect(()=>{
            x=x+"0"
            FetchSearch()
        },[name])
    
    return(<>
    <h1>{x}</h1>
    </>)
}   
export default FetchName
